create table specification_properties
(
    id            int unsigned auto_increment comment '规格项ID'
        primary key,
    source_id     int unsigned default 0                 not null comment '该项数据的拷贝来源，店铺的商品数据为同类平台数据的部分拷贝',
    property_code char(36)                               not null comment '规格项唯一标识',
    product_id    int unsigned                           not null comment '商品ID',
    name          varchar(32)                            not null comment '规格项名称',
    display_order int unsigned                           not null comment '排序（顺序）',
    created_at    datetime     default CURRENT_TIMESTAMP not null,
    updated_at    datetime                               null,
    deleted_at    datetime                               null
)
    collate = utf8mb4_unicode_ci;

create index specification_properties_product_id_index
    on specification_properties (product_id);

create index specification_properties_property_code_index
    on specification_properties (property_code);

create index specification_properties_source_id_index
    on specification_properties (source_id);

